(14, 1, 26, 5.00, 'yi', 1470051509),
(15, 1, 26, 0.00, 'оччень хороший водитель, даже не плюется из окна', 1470067110),
(16, 1, 26, 5.00, 'ну, как-то так...', 1470067731),
(17, 1, 26, 5.00, 'Или так...', 1470067748),
(18, 1, 26, 3.00, 'sdfdsaf', 1470130957),
(19, 1, 1, 5.00, 'Ну, как-то так', 1470297048),
(20, 1, 2, 5.00, 'Ооочень крутой водила (Джейсон Стетхем)', 1470657343),
(21, 26, 11, 3.00, 'etertertertretretreretretretretert', 1471358245),
(22, 25, 12, 5.00, 'Шабат Шалом ! Очень понгавился автомобиль ! Водитель очень отзывчивый человек, за небольшую дополнительную плату, оделся в национальный евгейский костюм, нацепил бутафогские пэйсы и весь день на пголет кгутил "Хава нагила".', 1471423378),
(23, 1, 12, 5.00, 'Таки подтвегждаю, всем понгавилось, и даже тетя Соня сказала, что это кошерно.\r\nНо цены могли бы быть и подемокгатичнее', 1471434983),
(24, 1, 13, 4.00, 'Норм, че', 1471722693);
