INSERT INTO `pages` (`id`, `title`, `text`, `active`) VALUES
(4, 'Как заказать', '<p>\r\nЗаказать\r\nу нас авто невероятно просто. Прежде\r\nвсего, просмотрите с Вашей “второй\r\nполовинкой” наш обширный каталог\r\nсвадебных автомобилей и выберите\r\nинтересующий вас вариант. \r\n</p><p>\r\nЗатем\r\nоформите онлайн-заявку, заполнив все\r\nнеобходимые поля. <br>Получив заявку,\r\nводитель отправит вам подтверждение\r\nброни на вашу дату. Следующий шаг –\r\nвнесение необходимой суммы предоплаты.</p><p>\r\nИ,\r\nнаконец, в день свадьбы вы получаете\r\nименно тот автомобиль, в котором вы\r\nмечтали приехать на самый яркий праздник\r\nВашей жизни.</p><p>\r\nС\r\nпомощью сервиса Weddingcars вы можете составить\r\nцелый свадебный кортеж. А также проследить\r\nза тем, чтобы он был выдержан в едином\r\nстиле, из автомобилей одной марки и\r\nцвета.</p><p>\r\nУслуги,\r\nпредоставляемые водителями,\r\nзарегистрированными на Weddingcars, не\r\nограничиваются свадебной перевозкой.\r\nВы можете найти и заказать автомобиль\r\nдля организации поездок, связанных с\r\nпроведением всевозможных праздников\r\nи мероприятий:</p><p>\r\n-\r\nтрансфер из вокзала, отеля;</p><p>\r\n-\r\nтуристические и экскурсионные поездки;</p><p>\r\n-\r\nдевичники и мальчишники, свидания;</p><p>\r\n-\r\nфото-сессии, выписка из роддома;</p><p>\r\n-\r\nобслуживание пикников, вечеринок,\r\nгородских и загородных мероприятий,\r\nпраздников (дни рождения, выпускной\r\nвечер, корпоративные вечеринки,\r\nпрезентации и многое другое).</p>', 1),
(11, 'О компании', '<p style="text-align: center;"><strong>Weddingcars</strong> - это первый в Полтаве и Украине открытый сервис поиска свадебных автомобилей. Мы выступаем в качестве посредника между водителями и клиентами. Водители, желающие предоставлять услуги свадебной перевозки, проходят проверку и регистрируются на нашей онлайн-площадке. </p><p style="text-align: justify;">Клиенты, в свою очередь, имеют возможность самостоятельно выбрать свадебный автомобиль на любой вкус и цвет из обширного перечня представленных вариантов.</p><p style="text-align: justify;">Одним из наших преимуществ является возможность выбора среди большого количества предложений. Вашему вниманию предлагаются различные варианты комплектации свадебного кортежа - легковые авто и внедорожники, ретро-автомобили, кабриолеты, лимузины и пр. На сервисе Weddingcars представлены авто любой ценовой категории – от моделей эконом-класса до автомашин класса люкс. Также можно найти и заказать комфортабельные автобусы и микроавтобусы, чтобы привезти на праздник всех ваших гостей.</p><p style="text-align: justify;">Авто, представленные в нашем каталоге, обладают безупречным внешним видом и отличным техническим состоянием. Водители, которые работают с Weddingcars, проходят обязательную проверку и подписывают договор-соглашение, содержащий условия сотрудничества, в том числе касаемо опрятного внешнего вида водителя и автомобиля, химчистки салона и пр.</p><p style="text-align: justify;">Рейтинг автомобилей и реальные отзывы посетителей на сайте помогут вам сделать действительно лучший выбор для вашего незабываемого праздника. Поэтому, если вы решили сделать Вашу свадьбу действительно яркой и незабываемой и получить исключительно положительные впечатления, воспользуйтесь услугами сервиса Weddingcars!</p>', 1);
